/* Add Overwatch popular pages module to right rail */
$(function() {
	var loadOWOnNamespaces = [0];
	if (($.inArray(mw.config.get('wgNamespaceNumber'), loadOWOnNamespaces) > -1) && !mw.config.get('wgIsMainPage')) {
		checkRightRailForOW = setInterval(addOWModule, 250);
	}
});
 
