function addClickTrackingToModule() {
	var track = Wikia.Tracker.buildTrackingFunction({
		category: 'ja-popularpages-module',
		action: Wikia.Tracker.ACTIONS.CLICK,
		trackingMethod: 'analytics'
	});
 
	var popularPagesModule = $('#WikiaRail .PopularPagesModule');
	popularPagesModule.on('mousedown', 'a', function(e) {
		var href = $(this).attr('href');
		track({
			browserEvent: e,
			label: href
		});
	});
}